window.bookSummaryJSON = "<p>As war breaks out without warning a group of cadets is forced to jump from school to combat without any time to ease themselves in. Unexpected enemies and the politics of the capital system pull them in different directions and strain the relationships and knowledge that is leftover from the academy. Despite the rigors of war, life still seems to find a way to interfere no matter how hard they try.</p>"; 
